import React, { Component } from 'react';
class ComicList extends Component {
    // constructor (){
    //     super()
    // }
    render() {
        return(
            <table className="comicThread">
                <tr>
                    <td className="comicItem">Comic return #1</td>
                    <td className="comicItem">Comic return #2</td>
                    <td className="comicItem">Comic return #3</td>
                </tr>
            </table>
        );
    }
}

export default ComicList;
